import { StyleSheet } from "react-native";
import { Dimensions } from "react-native";

const screenWidth = Dimensions.get("window").width;

export const styles = StyleSheet.create({
  header: {
    flexDirection: "row",
    alignItems: "center",
    backgroundColor: "#EF6C00",
    paddingTop: 30,
    paddingBottom: 10,
    paddingHorizontal: 20,
  },
  imagePerfilLogado: {
    borderRadius: 25,
    width: 40,
    height: 40,
  },
  viewHeader: {
    paddingLeft: 10,
  },
  text1Header: {
    color: "#FAFAFA",
    fontWeight: "bold",
  },
  imageSetinhaLogado: {
    marginLeft: 5,
    width: 12,
    height: 10,
  },
  imageLupa: {
    marginLeft: 210,
    width: 30,
    height: 30,
  },
  imageSininho: {
    marginLeft: 8,
    width: 30,
    height: 30,
  },
});
